import '../styles.css';
import Data from '../products.json';

export default function Products() {
    return (
        <div>
        {
            Data.map ( product => {
                return(
                    <div key={product.id}>
                   <strong></strong> {product.item_name}
                    </div>
                )
            })
        }
        </div>
    );
}
